// import '../scss/layouts/header.scss'
import Logo from '../public/images/houzz_logo.svg';


const Header = () => {
    return (
        <header>
            <style>{`
                .container{
                    height: 100%;
                }
            `}</style>
           <div className="container">
                <Logo style={{width:'114px'}}/>
           </div>
        </header>
    )
}

export default Header;
